import React from 'react';
import classes from './Bar.module.css';

const Bar = () => {
    return (
        <div className={classes.Bar}>
            <div className={classes.TotalPrice}>89</div>
            <button className={classes.Button}>Pay</button>
        </div>
    );
};

export default Bar;
